import React, { Component } from 'react'
import styled from 'styled-components'
import {device} from '../../DeviceLayout'
const NavBarComponent = styled.div`
    width: 100%;
    background-color: yellow;
    height: 60px;
    margin: auto;
`
const NavBarLinkComponent = styled.div`
  float: left;
  font-size: 20px;
  font-weight: 600;
  width: 33.33%
`
const LeftLinkComponent = styled.div`
  cursor: pointer;
  display: inline-block;
  margin: 20px 10px;
`
const Logo = styled.div`
  cursor: pointer;
  float: center;
  margin: 20 10px;
  text-align: center;
  font-size: 25px;
`
const RightLinksComponent = styled.div`
  cursor: pointer;
  display: inline-block;
  margin: 10px;
  float: right
`
class NavBar extends Component {
  render() {
    return (
      <NavBarComponent>

        <NavBarLinkComponent>
          <LeftLinkComponent>
            Buy
          </LeftLinkComponent>
          <LeftLinkComponent>
            Rent
          </LeftLinkComponent>
        </NavBarLinkComponent>

        <NavBarLinkComponent>
          <Logo>
            HomeBuy
          </Logo>
        </NavBarLinkComponent>

         <NavBarLinkComponent>
          <RightLinksComponent>
              Login/SignUp
          </RightLinksComponent>
          <RightLinksComponent>
              Sell
          </RightLinksComponent>
          <RightLinksComponent>
              Rental
          </RightLinksComponent>
          <RightLinksComponent>
            List
          </RightLinksComponent>
        </NavBarLinkComponent>

      </NavBarComponent>
    )
  }
}
export default NavBar
